4,903,0,'PARTITIONING_METHOD',0,'none'),(16794,34,903,0,'compatible',0,'N'),(16795,34,903,0,'optimizationLevel',0,'9'),(16796,34,903,0,'jsScript_name',0,'Main'),(16797,34,903,0,'jsScript_script',0,'var query = \"\";\nquery += getCreateSqlForOperational();\nquery += getCreateSqlForDataMart();\n\n// ==============================================\n\nfunction getCreateSqlForOperational() {\n\n  // Table name defintion.\n  var tableName = \"ope_rest_\";\n  if (is_document_subtype.equals(\'Y\')) {\n    tableName += \"documents\";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    tableName += \"folders\";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    tableName += \"aspects\";\n  }\n  tableName += \"_\" + class.replace(\":\", \"_\").trim();\n  if (tableName.length > parseInt(getVariable(\"table_name_max_length\",\"\"))) {\n    var postfix = \"_\" + id.trim();\n    tableName = tableName.substr(0, parseInt(getVariable(\"table_tame_max_length\",\"\")) - postfix.length);\n    tableName += postfix;\n  }\n\n  // Drop table command.\n  var query = \"\";\n  if (getVariable(\"force_creation\",\"\").equals(\'true\')) {\n    query += \"DROP TABLE IF EXISTS `\" + tableName + \"`; \";\n  }\n\n  // Create table definition.\n  query += \"CREATE TABLE \";\n  if (!getVariable(\"force_creation\",\"\").equals(\'true\')) {\n    query += \"IF NOT EXISTS \";\n  }\n  query += \"`\" + tableName + \"` (\";\n  query += \"`alfresco_id` smallint not null, \";\n  if (is_document_subtype.equals(\'Y\')) {\n    query += \"`document_node-dbid` int not null, \";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    query += \"`folder_node-dbid` int not null, \";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    query += \"`document_node-dbid` int null, \";\n    query += \"`folder_node-dbid` int null, \";\n  }\n\n  // Fields.\n  var propertyList = JSON.parse(properties);\n  for (var i=0; i < propertyList.list.length; ++i) {\n\n    var property = propertyList.list[i];\n\n    query += \"`\" + property.name.replace(\":\", \"_\") + \"` \";\n\n    switch(property.type) {\n      case \"d:boolean\":  query += \"boolean\";          break;\n      case \"d:date\":     query += \"date\";             break;\n      case \"d:datetime\": query += \"datetime\";         break;\n      case \"d:double\":   query += \"double precision\"; break;\n      case \"d:float\":    query += \"numeric\";          break;\n      case \"d:int\":      query += \"int\";              break;\n      case \"d:long\":     query += \"bigint\";           break;\n      case \"d:text\":     query += \"varchar(1024)\";    break;\n      default:           query += \"varchar(1024)\";    break;\n    }\n\n    query += \", \";\n  }\n\n  // Primary key.\n  if (is_document_subtype.equals(\'Y\')) {\n    query += \"PRIMARY KEY (`alfresco_id`, `document_node-dbid`), \";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    query += \"PRIMARY KEY (`alfresco_id`, `folder_node-dbid`), \";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    query += \"UNIQUE (`alfresco_id`, `document_node-dbid`, `folder_node-dbid`), \";\n  }\n\n  // Foreign keys.\n  query += \"FOREIGN KEY (`alfresco_id`) REFERENCES `dm_dim_alfresco` (`id`) ON UPDATE CASCADE ON DELETE CASCADE \";\n\n  // Ending of the queries.\n  query += \") ENGINE=InnoDB DEFAULT CHARSET=utf8; \";\n\n  return query;\n}\n\nfunction getCreateSqlForDataMart() {\n\n  // Table name defintion.\n  var tableName = \"dm_dim_\";\n  if (is_document_subtype.equals(\'Y\')) {\n    tableName += \"documents\";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    tableName += \"folders\";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    tableName += \"aspects\";\n  }\n  tableName += \"_\" + class.replace(\":\", \"_\").trim();\n  if (tableName.length > parseInt(getVariable(\"table_name_max_length\",\"\"))) {\n    var postfix = \"_\" + id.trim();\n    tableName = tableName.substr(0, parseInt(getVariable(\"table_name_max_length\",\"\")) - postfix.length);\n    tableName += postfix;\n  }\n\n  // Drop table command.\n  var query = \"\";\n  if (getVariable(\"force_creation\",\"\").equals(\'true\')) {\n    query += \"DROP TABLE IF EXISTS `\" + tableName + \"`; \";\n  }\n\n  // Create table definition.\n  query += \"CREATE TABLE \";\n  if (!getVariable(\"force_creation\",\"\").equals(\'true\')) {\n    query += \"IF NOT EXISTS \";\n  }\n  query += \"`\" + tableName + \"` (\";\n  if (is_document_subtype.equals(\'Y\')) {\n    query += \"`document_id` int not null, \";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    query += \"`folder_id` int not null, \";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    query += \"`document_id` int null, \";\n    query += \"`folder_id` int null, \";\n  }\n  query += \"`prog` smallint not null DEFAULT 1, \";\n\n  // Fields.\n  var propertyList = JSON.parse(properties);\n  for (var i=0; i < propertyList.list.length; ++i) {\n\n    var property = propertyList.list[i];\n\n    query += \"`\" + property.name.replace(\":\", \"_\") + \"` \";\n\n    switch(property.type) {\n      case \"d:boolean\":  query += \"boolean\";          break;\n      case \"d:date\":     query += \"date\";             break;\n      case \"d:datetime\": query += \"datetime\";         break;\n      case \"d:double\":   query += \"double precision\"; break;\n      case \"d:float\":    query += \"numeric\";          break;\n      case \"d:int\":      query += \"int\";              break;\n      case \"d:long\":     query += \"bigint\";           break;\n      case \"d:text\":     query += \"varchar(1024)\";    break;\n      default:           query += \"varchar(1024)\";    break;\n    }\n\n    query += \", \";\n  }\n\n  query += \"`alfresco_id` smallint not null, \";\n  query += \"`src_id` int not null, \";\n\n  // Primary key.\n  if (is_document_subtype.equals(\'Y\')) {\n    query += \"PRIMARY KEY (`document_id`, `prog`), \";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    query += \"PRIMARY KEY (`folder_id`, `prog`), \";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    query += \"UNIQUE (`document_id`, `folder_id`, `prog`), \";\n  }\n\n  // Foreign keys.\n  if (is_document_subtype.equals(\'Y\') || is_aspect.equals(\'Y\')) {\n    query += \"FOREIGN KEY (`document_id`) REFERENCES `dm_dim_documents` (`id`) ON UPDATE CASCADE ON DELETE CASCADE, \";\n  }\n  if (is_folder_subtype.equals(\'Y\') || is_aspect.equals(\'Y\')) {\n    query += \"FOREIGN KEY (`folder_id`) REFERENCES `dm_dim_folders` (`id`) ON UPDATE CASCADE ON DELETE CASCADE, \";\n  }\n  query += \"FOREIGN KEY (`alfresco_id`) REFERENCES `dm_dim_alfresco` (`id`) ON UPDATE CASCADE ON DELETE CASCADE \";\n\n  // Ending of the queries.\n  query += \") ENGINE=InnoDB DEFAULT CHARSET=utf8; \";\n\n  return query;\n}\n'),(16798,34,903,0,'jsScript_type',0,NULL),(16799,34,903,0,'field_name',0,'query'),(16800,34,903,0,'field_rename',0,'query'),(16801,34,903,0,'field_type',0,'String'),(16802,34,903,0,'field_length',-1,NULL),(16803,34,903,0,'field_precision',-1,NULL),(16804,34,903,0,'field_replace',0,'N'),(16805,34,903,0,'cluster_schema',0,NULL),(16806,34,903,0,'row_distribution_code',0,NULL),(16885,52,910,0,'PARTITIONING_SCHEMA',0,NULL),(16886,52,910,0,'PARTITIONING_METHOD',0,'none'),(16887,52,910,0,'id_connection',1,NULL),(16888,52,910,0,'commit',100,NULL),(16889,52,910,0,'sql_field',0,'query'),(16890,52,910,0,'insert_field',0,NULL),(16891,52,910,0,'update_field',0,NULL),(16892,52,910,0,'delete_field',0,NULL),(16893,52,910,0,'read_field',0,NULL),(16894,52,910,0,'sqlFromfile',0,'N'),(16895,52,910,0,'sendOneStatement',0,'N'),(16896,52,910,0,'cluster_schema',0,NULL),(16897,52,910,0,'row_distribution_code',0,NULL),(16898,52,911,0,'PARTITIONING_SCHEMA',0,NULL),(16899,52,911,0,'PARTITIONING_METHOD',0,'none'),(16900,52,911,0,'id_connection',1,NULL),(16901,52,911,0,'sql',0,'SELECT\n MIN(id) AS id,\n class,\n is_document_subtype,\n is_folder_subtype,\n is_aspect\nFROM\n dm_custom_metadata\nWHERE\n alfresco_id=${alfresco_id}\n AND is_active=\'Y\'\nGROUP BY\n class,